import React from 'react';
import './CompetenciaPortfolio.css';

const CompetenciaPortfolio = () => {
    return (
        <section className="competencia">
            <h2 className="titulo">Minhas Habilidades</h2>
            <ul className="competencia-lista">
                <li>Node.js</li>
                <li>Java</li>
                <li>API Rest</li>
                <li>React</li>
                <li>Git e GitHub</li>
                <li>HTML e CSS</li>
                <li>MongoDB</li>
            </ul>
        </section>
    );
};

export default CompetenciaPortfolio;
